Located on the corner of Pelle Street and Dacre Street, these brand new strata workshop units are suitable for those businesses looking for clean and affordable warehouse accommodation with roller doors and 8m high bay.

To use the premises only for one or more of the following purposes:
(i) general industry;
(ii) industrial trades;
(iii) light industry;
(iv) plant and equipment hire establishment;
(v) store;
(vi) warehouse.

Unit 1 - SOLD
Unit 2 - 240sqm
Unit 3 - 178sqm

For Lease @ $155/sqm pa
or Sale @ $1,950/sqm
